import React from 'react';
import { Dropdown } from 'react-native-material-dropdown';

export function leftComponent(props) {

    let data = [{
        value: 'Banana',
      }, {
        value: 'Mango',
      }, {
        value: 'Pear',
      }];

    return (
        <Dropdown
        label='Favorite Fruit'
        data={data}
      />
    );
}
export function CenterComponent(props) {



    return (
        <Dropdown
        label='Favorite Fruit'
        data={data}
      />
    );
}
